import React, { useState } from 'react';


const NasaCard = (props)=>{
    return 
    <div>
        <h2>{props.title}</h2>
        <h3>{props.date}</h3>
        <img>{props.url}</img>
        <p>{props.explanation}</p>
    </div>
}

export default NasaCard;
